import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import Header from "../header/header";
import Footer from "../footer/Footer";
import "./checkout.css";

const Checkout = () => {
  const [cart, setCart] = useState([]);
  const [total, setTotal] = useState(0);

  // Dummy Address Data
  const deliveryAddress = "45, Green Street, Sector 12..."; // Hardcoded address for now

  useEffect(() => {
    // Simulate fetching cart items
    const fetchCartItems = () => {
      const mockCart = [
        {
          id: 1,
          name: "Big Mac",
          image: "/images/bigmac.jpg",
          price: 120,
          quantity: 2,
        },
        {
          id: 2,
          name: "French Fries",
          image: "/images/fries.jpg",
          price: 50,
          quantity: 1,
        },
        {
          id: 3,
          name: "Chicken McNuggets",
          image: "/images/nuggets.jpg",
          price: 100,
          quantity: 1,
        },
      ];
      setCart(mockCart);
      const totalPrice = mockCart.reduce(
        (acc, item) => acc + item.price * item.quantity,
        0
      );
      setTotal(totalPrice);
    };

    fetchCartItems();
  }, []);

  return (
    <div>
      <Header />
      <div className="checkout-container">
        <section className="bill">
          <img src="images/arrow-left.png" alt="arrow-left" />
          <h2>Your Order Details</h2>
          <div className="order-details">
            <div className="items-section">
              {cart.map((item) => (
                <div
                  key={item.id}
                  className={item.id === 1 ? "item1" : "item"}
                >
                  <img src={item.image} alt={item.name} />
                  <div className="item-info">
                    <h3>{item.name}</h3>
                    <p>{item.quantity}x item</p>
                  </div>
                  <p className="price">₹{item.price * item.quantity}</p>
                </div>
              ))}
              <div className="notes">
                <label htmlFor="notes">Notes</label>
                <input id="notes" type="text" placeholder="Add order notes" />
              </div>
            </div>

            <div className="summary-section">
              <div className="delivery-address">
                <img src="images/delivery.png" alt="delivery location icon" />
                <div>
                  <span>Delivery Address</span>
                  <p>{deliveryAddress}</p>
                </div>
              </div>

              <div className="bill-summary">
                <p>
                  <span>Items</span> <span>₹{total}</span>
                </p>
                <p>
                  <span>Sales Tax</span> <span>₹10</span>
                </p>
                <p className="subtotal">
                  <span>Subtotal ({cart.length} items)</span>
                  <span>₹{total + 10}</span>
                </p>
              </div>
              <button className="payment-btn">Choose Payment Method</button>
            </div>
          </div>
        </section>
      </div>

      <Footer />
    </div>
  );
};

export default Checkout;
